import { FaStar, FaDice, FaStumbleupon, FaRunning } from "react-icons/fa"
import { Container, Row, Col } from 'reactstrap';
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";

const HomeMenu = () => {
    return ( 
        
<Container className="container1">
  <Row>
      <Col md={4}>
      <Link to="/DiceGame">
      <h1>Dice Game</h1>
      <FaDice/>
      </Link>
      </Col>

      <Col md={4}>
      <Link to="/JumpGame">
      <h1>Jump Game</h1>
      <FaRunning/>
      </Link>
      </Col>

      <Col>
      <Link to="/SnakeGame">
      <h1>Snake Game</h1>
      <FaStumbleupon/>
      </Link>
      </Col>

  </Row>
</Container>
     );
}

export default HomeMenu;
